import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './SuperAdminDashboard.css';

interface Hospital {
  id: string;
  name: string;
  location: string;
  adminEmail: string;
}

const SuperAdminDashboard: React.FC = () => {
  const navigate = useNavigate();
  const [hospitals, setHospitals] = useState<Hospital[]>([]);
  const [newHospital, setNewHospital] = useState({
    name: '',
    location: '',
    adminEmail: '',
  });

  useEffect(() => {
    // Check if user is super admin
    const userRole = localStorage.getItem('userRole');
    if (userRole !== 'super-admin') {
      navigate('/login');
    }
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('userRole');
    localStorage.removeItem('userEmail');
    navigate('/login');
  };

  const handleAddHospital = (e: React.FormEvent) => {
    e.preventDefault();
    // TODO: Replace with actual API call
    const hospital: Hospital = {
      id: Date.now().toString(),
      ...newHospital,
    };
    setHospitals([...hospitals, hospital]);
    setNewHospital({ name: '', location: '', adminEmail: '' });
  };

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setNewHospital(prev => ({
      ...prev,
      [name]: value
    }));
  };

  return (
    <div className="super-admin-dashboard">
      <header className="dashboard-header">
        <h1>Super Admin Dashboard</h1>
        <button onClick={handleLogout} className="logout-button">Logout</button>
      </header>

      <main className="dashboard-content">
        <section className="add-hospital-section">
          <h2>Add New Hospital</h2>
          <form onSubmit={handleAddHospital} className="add-hospital-form">
            <div className="form-group">
              <label htmlFor="name">Hospital Name:</label>
              <input
                type="text"
                id="name"
                name="name"
                value={newHospital.name}
                onChange={handleInputChange}
                required
              />
            </div>
            <div className="form-group">
              <label htmlFor="location">Location:</label>
              <input
                type="text"
                id="location"
                name="location"
                value={newHospital.location}
                onChange={handleInputChange}
                required
              />
            </div>
            <div className="form-group">
              <label htmlFor="adminEmail">Admin Email:</label>
              <input
                type="email"
                id="adminEmail"
                name="adminEmail"
                value={newHospital.adminEmail}
                onChange={handleInputChange}
                required
              />
            </div>
            <button type="submit" className="add-button">Add Hospital</button>
          </form>
        </section>

        <section className="hospitals-list-section">
          <h2>Registered Hospitals</h2>
          <div className="hospitals-list">
            {hospitals.map(hospital => (
              <div key={hospital.id} className="hospital-card">
                <h3>{hospital.name}</h3>
                <p><strong>Location:</strong> {hospital.location}</p>
                <p><strong>Admin Email:</strong> {hospital.adminEmail}</p>
                <div className="hospital-actions">
                  <button className="edit-button">Edit</button>
                  <button className="delete-button">Delete</button>
                </div>
              </div>
            ))}
          </div>
        </section>
      </main>
    </div>
  );
};

export default SuperAdminDashboard;
